import styled from 'styled-components'

const Outer = styled.footer`

    left: 0;
    bottom: 0;
    height: 4%;
    width: 100%;
    position: fixed;
    padding-bottom: 2%;
    text-align: center;
    background-color: #ffffff;
    borderTop: 2px solid #ededed;
    margin-top: 100px;

    ul {
        text-align: center;
        padding-top: 5px;
        margin-top: 20px;
        margin-right: 25px;
    }

    li {
        margin: 5px 10px 5px 0px;   
        display: inline;
    }

    a {
        font-size: 20px;
    }
`
export default Outer
